import Intro from "./components/intro/intro";
import About from "./components/about/about";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <div className="content">
          <Switch>
            <Route path="/">
              <Intro />
            </Route>
          </Switch>
          <About />
        </div>
      </div>
    </Router>
  );
}

export default App;
